import React from 'react';
import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router,Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="header">
        <div className="container">
        <nav className="navbar navbar-expand-lg navbar-light warna">
            <Link className="navbar-brand" to="/"><img className="logo" src={logo} alt="logo"></img></Link>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Togle navigation">
              <span className="navbar-toggler-icon"></span>
            </button>

            <div id="navbarSupportedContent" className="collapse navbar-collapse">
              <ul className="navbar-nav ml-auto">
                <li className="nav-item">
                  <Link className="nav-link" to="/pria" id="navbarDropdown" >Wanita</Link>
                </li>
                <li className="nav-item ">
                  <Link className="nav-link" to="/wanita" id="navbarDropdown" >Pria</Link>

                </li>
                <li className="nav-item">
                  <Link className="nav-link" id="navbarDropdown" to="/anak">Anak-anak</Link>
                </li>
              </ul>
            </div>
          </nav>
        </div>
      </div>
      <React.Fragment>
        <Route />
      </React.Fragment>
    </Router>
  );
}

export default App;
